BEGIN

	DECLARE varIdCorral CHAR(36);
    
    DECLARE vb_termina BOOL DEFAULT FALSE;
	
	DECLARE cur_corrales CURSOR
	FOR	SELECT	id_corral                                
		FROM	corral;

	DECLARE CONTINUE HANDLER 
	FOR SQLSTATE '02000'
