/*!50003 CREATE*/ /*!50020 DEFINER=`root`@`localhost`*/ /*!50003 PROCEDURE `nuevoIdConcepto`(varIdRancho int, varIdConcepto int, out varIdConsecutivo int )
BEGIN
	
	UPDATE	concepto_movimiento
	set		id_concecutivo	=	ifnull(id_concecutivo,0)	+	1
